/*global define*/
define('js!SBIS3.CONTROLS.Demo.MyHeader', [
   'js!SBIS3.CORE.CompoundControl',
   'Core/CommandDispatcher',
   'Core/helpers/collection-helpers',
   'html!SBIS3.CONTROLS.Demo.MyHeader',
   'js!SBIS3.CONTROLS.StylesPanelNew',
   'js!SBIS3.CONTROLS.Header',
   'html!SBIS3.CONTROLS.Demo.MyHeader/resources/mainArea',
   'tmpl!SBIS3.CONTROLS.Demo.MyHeader/resources/bottomArea',
   'css!SBIS3.CONTROLS.Demo.MyHeader',
   'js!SBIS3.CONTROLS.TabButtons',
   'js!SBIS3.CONTROLS.TextBox'
], function (CompoundControl, CommandDispatcher, colHelpers, dotTplFn, StylesPanel, Header) {

   var getInlineStyle = function(format) {
      var css = '';
      colHelpers.forEach(format, function(value, option) {
         css += option + ':' + value + ';';
      });
      return css;
   };

   var images = [
         "data:image/jpeg;base64,",
         "data:image/jpeg;base64,"
      ],
       logos = [
         "data:image/png;base64,",
          "data:image/png;base64,"
       ];
   'use strict';

   /**
    * SBIS3.CONTROLS.Demo.MyHeader
    * @class SBIS3.CONTROLS.Demo.MyHeader
    * @extends $ws.proto.CompoundControl
    * @control
    */
   var MyHeader = CompoundControl.extend(/** @lends SBIS3.CONTROLS.Demo.MyHeader.prototype */{
      _dotTplFn: dotTplFn,
      $protected: {
         _options: {
            context: {
               image: images[0],
               logo: logos[0],
               opacity: 0.6,
               captionText: 'Заголовок',
               descriptionText: 'Описание',
               theme: Header.Themes.BLACK,
               headerInlineStyles: getInlineStyle({
                  'font-size': '24px',
                  'color': 'auto',
                  'font-weight': 'bold'
               }),
               descriptionInlineStyle: getInlineStyle({
                  'font-size': '18px',
                  'color': 'auto'
               }),
               headerStyleCfg: {
                  'font-size': '24px',
                  'color': 'auto',
                  'font-weight': 'bold'
               },
               descriptionStyleCfg: {
                  'font-size': '18px',
                  'color': 'auto'
               }
            }
         },
         _header: undefined,
         _logoNumber: 0,
         _imageNumber: 0
      },

      init: function() {
         MyHeader.superclass.init.apply(this, arguments);
         this._header = this.getChildControlByName('MyHeader');
         this._captionTextBox = this.getChildControlByName('captionTextBox');
         this._descriptionTextBox = this.getChildControlByName('descriptionTextBox');
         this._header.subscribe('onBeginEdit', this._onBeginEdit.bind(this));
         this._header.subscribe('onEndEdit', this._onEndEdit.bind(this));

         //Редактирование сразу запущено
         //this._header.sendCommand('beginEdit');
      },

      $constructor: function() {
         CommandDispatcher.declareCommand(this, 'editCaption', this._editCaption.bind(this));
         CommandDispatcher.declareCommand(this, 'editLogo', this._editLogo.bind(this));
         CommandDispatcher.declareCommand(this, 'editBackground', this._editBackground.bind(this));
         this.getContext().subscribe('onFieldChange', this._onContextChange.bind(this));
      },

      _onContextChange: function(e, key, value) {
         if (!this._header.isEdit()) {
            //сохранить данные
         }
      },

      _onBeginEdit: function() {
         this._captionTextBox.setEnabled(true);
         this._descriptionTextBox.setEnabled(true);
      },

      _onEndEdit: function() {
         this._captionTextBox.setEnabled(false);
         this._descriptionTextBox.setEnabled(false);
      },

      _editLogo: function() {
         this._header.setLogo(logos[((++this._logoNumber) % 2)]);
      },

      _editBackground: function() {
         this._header.setImage(images[((++this._imageNumber) % 2)]);
      },

      _editCaption: function() {
         var
             self = this,
             panel = this._getStylePanel();
         panel.subscribe('changeFormat', function(e, inlineStyle) {
            self.getContext().setValue('headerInlineStyles', inlineStyle);
            self.getContext().setValue('headerStyleCfg', this.getJSONStyle());
         });
         panel.show();
      },

      _getStylePanel: function() {
         return new StylesPanel({
            corner: 'tl',
            target: this.getChildControlByName('header').getContainer(),
            element: $('<div></div>').appendTo($('body')),
            allowAutoColor: true,
            style: this.getContext().getValue('headerStyleCfg'),
            colors: [
               {color:'#000000'},
               {color:'#EF463A'},
               {color:'#72BE44'},
               {color:'#0055BB'},
               {color:'#A426D9'},
               {color:'#999999'},
               {color:'#ece8cd'},
               {color:'#eccdd1'},
               {color:'#e2cdec'},
               {color:'#cdd2ec'},
               {color:'#cdece5'},
               {color:'#e1eccd'}
            ],
            fontSizes: [18, 20, 22, 24, 26, 28]
         });
      }
   });
   return MyHeader;
});